pragma solidity ^0.4.19;

contract CarreraDeCaballos {

    struct Caballo {
        address id; //address;
        string nombreCaballo;
        string nombreJinete;
        uint edadCaballo;
        uint edadJinete;
        uint carrerasGanadas;
        uint carrerasTotales;
    }

    Caballo[] public caballos;

    //mapping (address => caballos) public horse;

    /*function setMapping(string _nombre, string jinete, uint _raza, uint _edad) {
        horse[msg.sender] = 
    }*/

    function crearCaballo(string _nombreCaballo, string _nombreJinete, uint _edadCaballo, uint _edadJinete) public {
        caballos.push(Caballo(msg.sender, _nombreCaballo, _nombreJinete, _edadCaballo, _edadJinete, 0, 0));
    }

}
